import React, { useState, useEffect } from 'react';
import { Canvas, extend } from '@react-three/fiber';
import { OrbitControls } from '@react-three/drei';
import * as THREE from 'three';

// Extend JSX Elements with Three.js objects
extend({
  Mesh: THREE.Mesh,
  BoxGeometry: THREE.BoxGeometry,
  SphereGeometry: THREE.SphereGeometry,
  CylinderGeometry: THREE.CylinderGeometry,
  CircleGeometry: THREE.CircleGeometry,
  TorusGeometry: THREE.TorusGeometry,
  MeshStandardMaterial: THREE.MeshStandardMaterial,
});

declare global {
  namespace JSX {
    interface IntrinsicElements {
      mesh: any;
      boxGeometry: any;
      sphereGeometry: any;
      cylinderGeometry: any;
      circleGeometry: any;
      torusGeometry: any;
      meshStandardMaterial: any;
      group: any;
    }
  }
}

// Steampunk material presets
const brassFinish = {
  color: '#b5a642',
  metalness: 1,
  roughness: 0.3,
  emissive: '#000000',
};

const copperFinish = {
  color: '#b87333',
  metalness: 1,
  roughness: 0.4,
  emissive: '#000000',
};

const glassFinish = {
  color: '#88ccff',
  metalness: 1,
  roughness: 0.1,
  emissive: '#4488ff',
  emissiveIntensity: 0.5,
  transparent: true,
  opacity: 0.7,
};

interface RobotPartProps {
  position?: [number, number, number];
  color: string;
  style: number;
  accessories?: {
    hat?: boolean;
    mustache?: boolean;
    lipstick?: boolean;
  };
}

const Accessories: React.FC<{ position: [number, number, number], accessories: RobotPartProps['accessories'] }> = 
  ({ position, accessories }) => {
  if (!accessories) return null;

  return (
    <group position={position}>
      {/* Cowboy Hat */}
      {accessories.hat && (
        <group position={[0, 0.8, 0]}>
          <mesh>
            <cylinderGeometry args={[0.5, 0.7, 0.2, 8]} />
            <meshStandardMaterial {...brassFinish} />
          </mesh>
          <mesh position={[0, -0.1, 0]}>
            <cylinderGeometry args={[0.3, 0.3, 0.1, 8]} />
            <meshStandardMaterial {...copperFinish} />
          </mesh>
        </group>
      )}
      {/* Mustache */}
      {accessories.mustache && (
        <group position={[0, -0.2, 0.4]}>
          <mesh rotation={[0, 0, -0.2]}>
            <boxGeometry args={[0.2, 0.05, 0.05]} />
            <meshStandardMaterial {...brassFinish} />
          </mesh>
          <mesh rotation={[0, 0, 0.2]}>
            <boxGeometry args={[0.2, 0.05, 0.05]} />
            <meshStandardMaterial {...brassFinish} />
          </mesh>
        </group>
      )}
      {/* Lipstick */}
      {accessories.lipstick && (
        <group position={[0, -0.3, 0.4]}>
          <mesh>
            <boxGeometry args={[0.3, 0.05, 0.05]} />
            <meshStandardMaterial color="#ff0000" metalness={0.8} roughness={0.2} />
          </mesh>
        </group>
      )}
    </group>
  );
};

const Gear: React.FC<{ position: [number, number, number], scale?: number, rotation?: [number, number, number] }> = 
  ({ position, scale = 1, rotation = [0, 0, 0] }) => (
  <group position={position} rotation={rotation}>
    <mesh>
      <cylinderGeometry args={[0.3 * scale, 0.3 * scale, 0.1 * scale, 12]} />
      <meshStandardMaterial {...brassFinish} />
    </mesh>
    {Array.from({ length: 8 }).map((_, i) => (
      <mesh key={i} position={[
        Math.cos(i * Math.PI / 4) * 0.4 * scale,
        0,
        Math.sin(i * Math.PI / 4) * 0.4 * scale
      ]}>
        <boxGeometry args={[0.1 * scale, 0.1 * scale, 0.2 * scale]} />
        <meshStandardMaterial {...brassFinish} />
      </mesh>
    ))}
  </group>
);

const Pipe: React.FC<{ start: [number, number, number], end: [number, number, number], radius?: number }> = 
  ({ start, end, radius = 0.1 }) => {
  const direction = new THREE.Vector3().subVectors(
    new THREE.Vector3(...end),
    new THREE.Vector3(...start)
  );
  const length = direction.length();
  const center = new THREE.Vector3().addVectors(
    new THREE.Vector3(...start),
    direction.multiplyScalar(0.5)
  );
  const rotation = new THREE.Euler().setFromVector3(
    new THREE.Vector3(
      Math.atan2(direction.z, direction.y),
      Math.atan2(direction.x, direction.z),
      Math.atan2(direction.y, direction.x)
    )
  );

  return (
    <group position={[center.x, center.y, center.z]} rotation={[rotation.x, rotation.y, rotation.z]}>
      <mesh>
        <cylinderGeometry args={[radius, radius, length, 8]} />
        <meshStandardMaterial {...copperFinish} />
      </mesh>
      <mesh position={[0, length/2, 0]}>
        <torusGeometry args={[radius * 1.5, radius * 0.3, 8, 8]} />
        <meshStandardMaterial {...brassFinish} />
      </mesh>
      <mesh position={[0, -length/2, 0]}>
        <torusGeometry args={[radius * 1.5, radius * 0.3, 8, 8]} />
        <meshStandardMaterial {...brassFinish} />
      </mesh>
    </group>
  );
};

const RobotHead: React.FC<RobotPartProps> = ({ position = [0, 2, 0], color, style, accessories }) => {
  const [expression, setExpression] = useState('neutral');
  const [isBlinking, setIsBlinking] = useState(false);

  // Add blinking animation
  useEffect(() => {
    const blinkInterval = setInterval(() => {
      setIsBlinking(true);
      setTimeout(() => setIsBlinking(false), 200);
    }, 3000);
    return () => clearInterval(blinkInterval);
  }, []);

  const getEyeExpression = () => {
    switch (expression) {
      case 'happy':
        return { scale: [1, 0.5, 1], rotation: [0, 0, 0] };
      case 'surprised':
        return { scale: [1, 1.2, 1], rotation: [0, 0, 0] };
      case 'angry':
        return { scale: [1, 0.3, 1], rotation: [0, 0, -0.2] };
      default:
        return { scale: [1, 1, 1], rotation: [0, 0, 0] };
    }
  };

  const getMouthExpression = () => {
    switch (expression) {
      case 'happy':
        return { scale: [1, 0.5, 1], rotation: [0, 0, 0] };
      case 'surprised':
        return { scale: [1, 1.2, 1], rotation: [0, 0, 0] };
      case 'angry':
        return { scale: [1, 0.3, 1], rotation: [0, 0, 0] };
      default:
        return { scale: [1, 1, 1], rotation: [0, 0, 0] };
    }
  };

  const headGeometries = [
    // Style 1: Humanoid Head with Detailed Features
    <group position={position} key="head1">
      <mesh>
        <sphereGeometry args={[0.7, 32, 32]} />
        <meshStandardMaterial color={color} metalness={0.8} roughness={0.2} />
      </mesh>
      {/* Interactive Eyes */}
      <group position={[0.25, 0.1, 0.5]} scale={isBlinking ? [1, 0.1, 1] : getEyeExpression().scale} rotation={getEyeExpression().rotation}>
        <mesh>
          <sphereGeometry args={[0.1, 16, 16]} />
          <meshStandardMaterial color="#ffffff" />
        </mesh>
        <mesh position={[0, 0, 0.01]}>
          <sphereGeometry args={[0.05, 16, 16]} />
          <meshStandardMaterial color="#000000" />
        </mesh>
      </group>
      <group position={[-0.25, 0.1, 0.5]} scale={isBlinking ? [1, 0.1, 1] : getEyeExpression().scale} rotation={getEyeExpression().rotation}>
        <mesh>
          <sphereGeometry args={[0.1, 16, 16]} />
          <meshStandardMaterial color="#ffffff" />
        </mesh>
        <mesh position={[0, 0, 0.01]}>
          <sphereGeometry args={[0.05, 16, 16]} />
          <meshStandardMaterial color="#000000" />
        </mesh>
      </group>
      {/* Eyebrows */}
      <mesh position={[0.3, 0.2, 0.5]} rotation={[0, 0, expression === 'angry' ? -0.4 : -0.2]}>
        <boxGeometry args={[0.2, 0.02, 0.02]} />
        <meshStandardMaterial color="#000000" />
      </mesh>
      <mesh position={[-0.3, 0.2, 0.5]} rotation={[0, 0, expression === 'angry' ? 0.4 : 0.2]}>
        <boxGeometry args={[0.2, 0.02, 0.02]} />
        <meshStandardMaterial color="#000000" />
      </mesh>
      {/* Nose */}
      <mesh position={[0, -0.1, 0.6]}>
        <sphereGeometry args={[0.08, 16, 16]} />
        <meshStandardMaterial color={color} metalness={0.8} roughness={0.2} />
      </mesh>
      {/* Interactive Mouth */}
      <group position={[0, -0.3, 0.5]} scale={getMouthExpression().scale} rotation={getMouthExpression().rotation}>
        <mesh>
          <torusGeometry args={[0.2, 0.02, 8, 8]} />
          <meshStandardMaterial color="#000000" />
        </mesh>
      </group>
      {/* Expression Controls */}
      <mesh position={[0, -0.5, 0.5]} onClick={() => setExpression('happy')}>
        <boxGeometry args={[0.1, 0.1, 0.1]} />
        <meshStandardMaterial color="#00ff00" transparent opacity={0.5} />
      </mesh>
      <mesh position={[0.2, -0.5, 0.5]} onClick={() => setExpression('surprised')}>
        <boxGeometry args={[0.1, 0.1, 0.1]} />
        <meshStandardMaterial color="#ffff00" transparent opacity={0.5} />
      </mesh>
      <mesh position={[-0.2, -0.5, 0.5]} onClick={() => setExpression('angry')}>
        <boxGeometry args={[0.1, 0.1, 0.1]} />
        <meshStandardMaterial color="#ff0000" transparent opacity={0.5} />
      </mesh>
      <mesh position={[0.4, -0.5, 0.5]} onClick={() => setExpression('neutral')}>
        <boxGeometry args={[0.1, 0.1, 0.1]} />
        <meshStandardMaterial color="#ffffff" transparent opacity={0.5} />
      </mesh>
      <Accessories position={[0, 0, 0]} accessories={accessories} />
    </group>,
    
    // Style 2: Friendly Robot Head
    <group position={position} key="head2">
      <mesh>
        <sphereGeometry args={[0.7, 32, 32]} />
        <meshStandardMaterial color={color} metalness={0.8} roughness={0.2} />
      </mesh>
      {/* Large Expressive Eyes */}
      <mesh position={[0.3, 0.1, 0.5]}>
        <sphereGeometry args={[0.15, 16, 16]} />
        <meshStandardMaterial color="#ffffff" />
      </mesh>
      <mesh position={[0.3, 0.1, 0.55]}>
        <sphereGeometry args={[0.05, 16, 16]} />
        <meshStandardMaterial color="#000000" />
      </mesh>
      <mesh position={[-0.3, 0.1, 0.5]}>
        <sphereGeometry args={[0.15, 16, 16]} />
        <meshStandardMaterial color="#ffffff" />
      </mesh>
      <mesh position={[-0.3, 0.1, 0.55]}>
        <sphereGeometry args={[0.05, 16, 16]} />
        <meshStandardMaterial color="#000000" />
      </mesh>
      {/* Smiling Mouth */}
